import React from 'react';
import { Link } from "react-router-dom";

export default function ArticleCard({title,description,slug,date,img,key}) {
    return (
        <div className="row" key={key}>
            <div className="col col-sm-6 col-xs-12">
                <h2>{title}</h2>
                <p>{description}<Link to={slug}>Read More...</Link></p>
                <span>{date}</span>
            </div>
            <div className="col col-sm-6 col-xs-12 ">
                <img src={img} height="300px" width="400px"/>
            </div>
        </div>
    )
}
